class SelectedCategories extends StatefulWidget {
  SelectedCategories({Key? key}) : super(key: key);

  @override
  State<SelectedCategories> createState() => _SelectedCategoriesState();
}

class _SelectedCategoriesState extends State<SelectedCategories> {
  final controller = Get.find<HomePageController>();
  bool isPressed = false;
  @override
  Widget build(BuildContext context) {
    return Obx(() => Scaffold(
          appBar: AppBar(
            centerTitle: true,
            title: Text(controller.selectedCategories[0].name),
          ),
          body: ListView.builder(
              shrinkWrap: true,
              itemCount: controller.selectedCategories.length,
              itemBuilder: (BuildContext context, int index) {
                return Container(
                    color: const Color(0xffF9F4E4),
                    padding: const EdgeInsets.all(8.0),
                    child: isPressed
                        ? ListView.separated(
                            shrinkWrap: true,
                            separatorBuilder: (context, index) =>
                                SizedBox(height: 20),
                            itemBuilder: (ctx, i) {
                              return InkWell(
                                onTap: () {
                                  setState(() {
                                    isPressed = !isPressed;
                                  });
                                },
                                child: ListTile(
                                  trailing: controller
                                              .selectedCategories[index].name
                                              .toString() ==
                                          "cat"
                                      ? ClipRRect(
                                          borderRadius:
                                              BorderRadius.circular(300),
                                          child: Image.network(
                                            cats[i].image,
                                            fit: BoxFit.cover,
                                            height: 40,
                                            width: 40,
                                          ),
                                        )
                                      : Container(
                                          color: Colors.green,
                                          width: 800,
                                          height: 200,
                                          padding:
                                              const EdgeInsets.only(left: 20),
                                          alignment: Alignment.bottomCenter,
                                          child: Text(
                                            dogs[i].usage,
                                            style: const TextStyle(
                                                color: Colors.white),
                                          )),
                                  title: Text(controller
                                              .selectedCategories[index].name
                                              .toString() ==
                                          "cat"
                                      ? cats[i].type
                                      : dogs[i].type),
                                ),
                              );
                            },
                            itemCount: cats.length,
                          )
                        : Card(
                            color: Colors.green,
                            child: InkWell(
                                onTap: () {
                                  setState(() {
                                    isPressed = !isPressed;
                                  });
                                },
                                child: Padding(
                                    padding: const EdgeInsets.all(8.0),
                                    child: Row(
                                        mainAxisAlignment:
                                            MainAxisAlignment.spaceBetween,
                                        children: [
                                          Text(
                                            controller
                                                .selectedCategories[index].name
                                                .toString(),
                                          ),
                                          ClipRRect(
                                              borderRadius:
                                                  BorderRadius.circular(300),
                                              child: Image.network(
                                                  controller
                                                      .selectedCategories[index]
                                                      .image
                                                      .toString(),
                                                  height: 200))
                                        ])))));
              }),
        ));
  }
}

class CategoryFilter extends StatelessWidget {
  CategoryFilter({Key? key}) : super(key: key);

  final controller = Get.put(HomePageController());

  @override
  Widget build(BuildContext context) {
    return Obx(
      () => ListView.builder(
        shrinkWrap: true,
        itemBuilder: (ctx, i) {
          return CheckboxListTile(
            title: CategoryWidget(
              category: controller.categories[i],
            ),
            onChanged: (bool? selected) {
              controller.toggle(controller.categories[i]);
              Navigator.push(
                  context,
                  MaterialPageRoute(
                      builder: (context) => SelectedCategories()));
            },
            value: controller.selectedCategories
                .contains(controller.categories[i]),
          );
        },
        itemCount: controller.categories.length,
      ),
    );
  }
}

class Cat {
  final String type;
  final String image;
  final int rank;
  Cat({
    required this.type,
    required this.rank,
    required this.image,
  });
}

class Dog {
  final String type;
  final int rank;
  final String usage;
  Dog({
    required this.type,
    required this.rank,
    required this.usage,
  });
}

class HomePageController extends GetxController {
  final _categories = {
    Category(
            name: "dog",
            image:
                "data:image/jpeg;base64,"):
        false,
    Category(
            name: "cat",
            image:
                "https://hips.hearstapps.com/hmg-prod.s3.amazonaws.com/images/cute-cat-photos-1593441022.jpg?crop=0.670xw:1.00xh;0.167xw,0&resize=640:*"):
        false
  }.obs;

  void toggle(Category item) {
    _categories[item] = !(_categories[item] ?? true);
    update();
  }

  get selectedCategories => _categories.entries
      .where((element) => element.value)
      .map((e) => e.key)
      .toList();

  get categories => _categories.entries.map((e) => e.key).toList();
}

class Category {
  final String name;
  final String image;
  Category({
    required this.name,
    required this.image,
  });
}

class CategoryWidget extends StatelessWidget {
  final Category category;
  CategoryWidget({Key? key, required this.category}) : super(key: key);

  @override
  Widget build(BuildContext context) {
    return Row(
      children: [
        Text(
          category.name,
          style: const TextStyle(color: Colors.black),
        ),
        const SizedBox(width: 2),
        ClipRRect(
          borderRadius: BorderRadius.circular(20),
          child: Image.network(
            category.image,
            height: 40,
            width: 40,
            fit: BoxFit.cover,
          ),
        ),
      ],
    );
  }
}

class MyHomePage extends StatefulWidget {
  const MyHomePage({super.key, required this.title});

  // This widget is the home page of your application. It is stateful, meaning
  // that it has a State object (defined below) that contains fields that affect
  // how it looks.

  // This class is the configuration for the state. It holds the values (in this
  // case the title) provided by the parent (in this case the App widget) and
  // used by the build method of the State. Fields in a Widget subclass are
  // always marked "final".

  final String title;

  @override
  State<MyHomePage> createState() => _MyHomePageState();
}

class _MyHomePageState extends State<MyHomePage> {
  int _counter = 0;

  void _incrementCounter() {
    setState(() {
      // This call to setState tells the Flutter framework that something has
      // changed in this State, which causes it to rerun the build method below
      // so that the display can reflect the updated values. If we changed
      // _counter without calling setState(), then the build method would not be
      // called again, and so nothing would appear to happen.
      _counter++;
    });
  }

  @override
  Widget build(BuildContext context) {
    // This method is rerun every time setState is called, for instance as done
    // by the _incrementCounter method above.
    //
    // The Flutter framework has been optimized to make rerunning build methods
    // fast, so that you can just rebuild anything that needs updating rather
    // than having to individually change instances of widgets.
    return Scaffold(
      appBar: AppBar(
        // Here we take the value from the MyHomePage object that was created by
        // the App.build method, and use it to set our appbar title.
        title: Text(widget.title),
      ),
      body: Center(
        // Center is a layout widget. It takes a single child and positions it
        // in the middle of the parent.
        child: Column(
          // Column is also a layout widget. It takes a list of children and
          // arranges them vertically. By default, it sizes itself to fit its
          // children horizontally, and tries to be as tall as its parent.
          //
          // Invoke "debug painting" (press "p" in the console, choose the
          // "Toggle Debug Paint" action from the Flutter Inspector in Android
          // Studio, or the "Toggle Debug Paint" command in Visual Studio Code)
          // to see the wireframe for each widget.
          //
          // Column has various properties to control how it sizes itself and
          // how it positions its children. Here we use mainAxisAlignment to
          // center the children vertically; the main axis here is the vertical
          // axis because Columns are vertical (the cross axis would be
          // horizontal).
          mainAxisAlignment: MainAxisAlignment.center,
          children: <Widget>[
            const Text(
              'You have pushed the button this many times:',
            ),
            Text(
              '$_counter',
              style: Theme.of(context).textTheme.headline4,
            ),
          ],
        ),
      ),
      floatingActionButton: FloatingActionButton(
        onPressed: _incrementCounter,
        tooltip: 'Increment',
        child: const Icon(Icons.add),
      ), // This trailing comma makes auto-formatting nicer for build methods.
    );
  }
}
